                    {/* Status pill */}
                    {col.key === "status" && (
                      <span
                        className={
                          "px-3 py-1 rounded-full text-xs font-semibold " +
                          (row[col.key] === "In-process"
                            ? "bg-yellow-100 text-yellow-800"
                            : row[col.key] === "Complete"
                            ? "bg-green-100 text-green-800"
                            : row[col.key] === "Blocked"
                            ? "bg-red-100 text-red-800"
                            : row[col.key] === "Need to start"
                            ? "bg-blue-100 text-blue-800"
                            : "bg-gray-100 text-gray-800")
                        }
                      >
                        {row[col.key]}
                      </span>
                    )}
                    {/* Priority pill */}
                    {col.key === "priority" && (
                      <span
                        className={
                          "px-3 py-1 rounded-full text-xs font-semibold " +
                          (row[col.key] === "High"
                            ? "bg-red-100 text-red-700"
                            : row[col.key] === "Medium"
                            ? "bg-yellow-100 text-yellow-700"
                            : row[col.key] === "Low"
                            ? "bg-blue-100 text-blue-700"
                            : "bg-gray-100 text-gray-700")
                        }
                      >
                        {row[col.key]}
                      </span>
                    )}
                    {/* Default cell */}
                    {col.key !== "status" && col.key !== "priority" && row[col.key]}
                  </td>
                ))}
              </tr>
            ))}
            {/* Render empty rows to fill the table */}
            {Array.from({ length: 20 - data.length }).map((_, idx) => (
              <tr key={`empty-${idx}`}>
                <td className="px-4 py-2 border-b border-r border-gray-200 text-gray-300">{data.length + idx + 1}</td>
                {columns.map((col, colIdx) => (
                  <td
                    key={col.key}
                    className="px-4 py-2 border-b border-r border-gray-200 cursor-pointer"
                    onClick={() => handleClick(`${col.label} cell row ${data.length + idx + 1}`)}
                  >
                    &nbsp;
                  </td>
                ))}
              </tr>
            ))}
          </tbody>
        </table>
      </div>
